void printBytes(const unsigned char *buf, int len, const char *pre, const char *post)
{
    if (pre)
    {
        printf("%s", pre);
    }
    for (int i = 0; i < len; ++i)
    {
        printf("%02x", buf[i]);
    }
    if (post)
    {
        printf("%s", post);
    }
}

void printChars(const unsigned char *buf, int len, const char *pre, const char *post)
{
    if (pre)
    {
        printf("%s", pre);
    }

    const unsigned char* pChar = buf;
    const unsigned char* pTmp = 0;
    int i, j;

    printf("=======================================================================\n");

    while(len)
    {
        printf("%04lx: ",(unsigned long)(pChar - buf));

        pTmp = pChar;
        for (j = 0; j < 16; j++)
        {
            printf("%02X", (unsigned char) (*pChar++));
            if (! --len)
            {
                break;
            }
            j == 7 ? printf("-") : printf(" ");
        }

        for (i = 0; i <= 3 * (15 - j); i++)
        {
            printf(" ");
        }

        printf(" ");
        while (pTmp < pChar)
        {
            if (*pTmp >= 32 && *pTmp <= 126)
                printf("%c", *pTmp);
            else
                printf(".");

            pTmp++;
        }

        printf("\n");
    }
    printf("=======================================================================\n");

    if (post)
    {
        printf("%s", post);
    }
}

